// src/components/Todo.js
import React from 'react';

const Todo = ({ todo, deleteTodo }) => {
  return (
    <div className="TodoItem">
      <span>{todo.title} - {todo.completed ? 'Completed' : 'Incomplete'}</span>
      <button onClick={() => deleteTodo(todo.id)}>Delete</button>
    </div>
  );
};

export default Todo;
